const Contact = () => {
  return (
    <div className='contact-info'>
      <h1>Contact</h1>

      <p>
        "Certainly, I understand your preference for a more humble and
        understated tone. Here's a revised version that aligns with your vibe:
        "Hello, I'm Brian, the founder of a landscaping venture that draws upon
        my 25-year career as a User Interface Software Engineer. Following the
        conclusion of my Microsoft contract, I chose to pivot towards my passion
        for crafting aesthetically pleasing outdoor spaces. This journey is
        about exploring the possibilities ahead while weaving my software
        expertise into my newfound endeavor. I believe in embracing the present
        moment to shape the future, regardless of where this path leads. It's an
        honor to embark on this journey, staying true to my values and the
        pursuit of growth.""
      </p>
      <p>
        <strong>Email:</strong>{' '}
        <a href='mailto:info.curbAppeal@gmail.com'>info.curbAppeal@gmail.com</a>
      </p>
    </div>
  );
};

export default Contact;
